<h1 class="title toc-ignore">Manifold learning in R - Shiny App</h1>
<h4 class="author">Jackson Kwok</h4>
<h4 class="date">2020-04-07</h4>



<p>Use the following function to start the Shiny app for this package:</p>
<pre><code>library(maniTools)
run_example()</code></pre>
